import React from 'react'

const Search = () => {
	return (
		<div>
			<form className="form">
				<input 
					type="text" 
					name="text" 
					placeholder="Search Users..." 
					value={userInput.text}
					onChange={this.onChange}
				/>
				<input type="submit" value="Search" className="btn btn-dark btn-block"/>
			</form>
		</div>
	)
}

const userInput = {
	text: ""
}

export default Search
